<template>
    <div id="email-url">
        <a href="#" @click.prevent="dialog = !dialog" class="link">
            <div class="d-flex flex-row align-items-center justify-content-center">
                <div class="wpp-icon mr-2" v-if="type == 'wpp'" />
                <slot />
            </div>
        </a>
        <el-dialog :title="f_type" :visible.sync="dialog" width="45%" :close-on-click-modal="false">
            <template v-if="type == 'email'">
                <span>Preencha o formulário com os dados para envio do email</span>
                <form v-on:submit.prevent="sendEmail">
                    <div class="row mt-4 mb-2">
                        <div class="col-12">
                            <label>Destinatário</label>
                            <input class="form-control" disabled readonly :value="email.to" />
                        </div>
                    </div>
                    <div class="row mb-2">
                        <div class="col-12">
                            <label>Assunto *</label>
                            <input class="form-control" v-model="email.subject" />
                        </div>
                    </div>
                    <div class="row mb-4">
                        <div class="col-12">
                            <label>Mensagem *</label>
                            <textarea class="form-control" v-model="email.body" rows="5" />
                        </div>
                    </div>
                    <span slot="footer" class="dialog-footer">
                        <div class="d-flex justify-content-end">
                            <el-button @click="cancel">Cancelar</el-button>
                            <el-button type="primary" @click="sendEmail">Enviar</el-button>
                        </div>
                    </span>
                </form>
            </template>
            <template v-if="type == 'wpp'">
                <span>Preencha o formulário com os dados para envio da mensagem via whatsapp</span>
                <form v-on:submit.prevent="sendEmail">
                    <div class="row mt-4 mb-2">
                        <div class="col-12">
                            <label>Destinatário</label>
                            <input class="form-control" disabled readonly :value="wpp.to" />
                        </div>
                    </div>
                    <div class="row mb-4">
                        <div class="col-12">
                            <label>Mensagem *</label>
                            <textarea class="form-control" v-model="wpp.body" rows="5" />
                        </div>
                    </div>
                    <span slot="footer" class="dialog-footer">
                        <div class="d-flex justify-content-end">
                            <el-button @click="cancel">Cancelar</el-button>
                            <el-button type="primary" @click="sendWpp">Enviar</el-button>
                        </div>
                    </span>
                </form>
            </template>
        </el-dialog>
    </div>
</template>
<script>
export default {
    props: ['value', 'type'],
    computed: {
        f_type() {
            switch (this.type) {
                case 'email':
                    return 'Email'
                    break
                case 'wpp':
                    return 'Whatsapp'
                    break
                default:
                    return
                    break
            }
        },
    },
    data() {
        return {
            dialog: false,
            wpp: {
                body: '',
                to: this.value,
            },
            email: {
                body: '',
                subject: '',
                to: this.value,
            },
        }
    },
    methods: {
        cancel() {
            this.dialog = false
            this.email.body = ''
            this.wpp.body = ''
            this.email.subject = ''
        },
        sendEmail() {
            if (!this.email.subject) return this.$message.error('Assunto é um campo obrigatório')
            if (!this.email.body) return this.$message.error('Digite a mensagem que deseja enviar')
            window.open(`mailto:${this.email.to}?subject=${this.email.subject}&body=${this.email.body}`)
        },
        sendWpp() {
            if (!this.wpp.body) return this.$message.error('Digite a mensagem que deseja enviar')
            let formated = this.wpp.to.replace(/\D/g, '')
            window.open(`https://api.whatsapp.com/send?phone=+55${formated}&text=${this.wpp.body}`)
        },
    },
}
</script>
<style lang="scss">
#email-url {
    .wpp-icon {
        background-size: contain;
        background-repeat: no-repeat;
        height: 18px;
        width: 18px;
        background-image: url(data:image/png;base64,);
    }
}
.el-dialog__body,
.el-dialog__header {
    display: flex;
    flex-direction: column;
    justify-content: flex-start;
    text-align: left;
}
</style>